//Show all train details to the users
import React ,{Component} from 'react';
import axios from 'axios';

const Details = props => (
    <tr>
        <td><b>{props.details.route}</b></td>
        <td><b>{props.details.time}</b></td>
        <td><b>{props.details.ticketPrice }</b></td>
    </tr>
)

export default class ViewAlldata extends Component{

    constructor(props){
        super(props);
        this.state = {ticketsD :[]};
    }

    componentDidMount(){
        //get train tickets details from the backend
        axios.get('http://localhost:4000/trainresevation')
             .then(response => {
                 this.setState({ ticketsD : response.data});
             })
             .catch(function (error){
                 console.log(error);
             })
    }

    viewExams(){
        return this.state.ticketsD.map(function(currentDetail ,i){
            return <Details details = {currentDetail} key = {i} />
        });
    }


    render(){
        return(
            <div>
                <h1><b><i>AVAILABLE </i></b></h1>
                <table className = " tablecss table table-bordered table-hover table-striped" style={{ marinTop:20}}>
                    <thead>
                        <tr>
                            <th><h2>Name</h2></th>
                            <th><h2>EntrollmentKey</h2></th>
                            <th><h2>Module</h2></th>
                            <th><h2>Duration</h2></th>
                            <th><h2>Question</h2></th>

                        </tr>

                    </thead>
                    <tbody>
                        {this.viewExams()}
                    </tbody>
                </table>
            </div>


        )
    }

}
